class animal{
    myName = "animal"

    constructor (){
        this.alive = true;
    }

    eat(){
        console.log(`${this.myName} is eating`)
    }
}

function main(){
    const anim = new animal();
    console.log(anim);
    anim.eat();
}

export default main;
